import { storageService } from "./order-storage.service.js";
import { httpService } from "./http.service.js";

const STORAGE_KEY = "orders";

export const orderService = {
  saveOrder,
  charge,
};

//CHOOSE localstorageService OR httpService
async function saveOrder(order) {
  console.log("service front order", order);
  // return await storageService.post(STORAGE_KEY, order);
  return httpService.post("order/", order);
}

async function charge() {
  const data = {
    TerminalNumber: 1000,
    Operation: 1,
    UserName: "MyTestUser",
    SumToBill: 12,
    CoinID: 1,
    Language: "he",
    ProductName: "test",
    APILevel: 10,
    SuccessRedirectUrl: "http://www.site.com/Success.html",
    ErrorRedirectUrl:
      "http://www.site.com/Error.html&IndicatorUrl=http://www.stie.com/hide.aspx",
    codepage: 65001,
  };

  const endPoint = "https://secure.cardcom.solutions/Interface/LowProfile.aspx";
  console.log(httpService.post(endPoint, data));
}
